string[] split = data.Split("\r\n");
List<string> numbers = new List<string>() { "1", "2", "3", "4", "5", "6", "7", "8", "9", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine" };
int result = 0;
int indexCounter = 0;
string currentLine = "";

foreach (string line in split)
{
    currentLine = line;
    string number = Subbie(line);
    result += int.Parse(number);
}

Console.WriteLine(result);


string Subbie(string line)
{
    string? firstNumber = null;
    string? lastNumber = null;


    foreach (char character in line)
    {
        string? number = CheckCharacter(character);

        if (number != null)
        {
            if (firstNumber == null) {  firstNumber = number; }
            else { lastNumber = number; }
        }

        indexCounter++;
    }
    indexCounter = 0;
    if (lastNumber == null) { lastNumber = firstNumber; }

    firstNumber = ConvertNumberNameToNumber(firstNumber);
    lastNumber = ConvertNumberNameToNumber(lastNumber);

    return firstNumber + lastNumber;
}

string? CheckCharacter(char character)
{
    foreach (var number in numbers)
    {
        if (number.StartsWith(character))
        {
            if (isIndexAtANumber(number))
            {
                return number;
            }
        }
    }
    return null;
}

bool isIndexAtANumber(string number)
{
    string potentialNumber = "";

	try
    {
		potentialNumber = currentLine.Substring(indexCounter, number.Length);
	}
	catch (ArgumentOutOfRangeException) {}

    if (potentialNumber == number)
    {
        return true;
    }
    return false;
}

string ConvertNumberNameToNumber(string numberString)
{
	switch (numberString.ToLower())
	{
		case "one":
			return "1";
		case "two":
			return "2";
		case "three":
			return "3";
		case "four":
			return "4";
		case "five":
			return "5";
		case "six":
			return "6";
		case "seven":
			return "7";
		case "eight":
			return "8";
		case "nine":
			return "9";
		default:
			return numberString;
	}
}









